import React from 'react';
class Test extends React.Component{
    render()
    {return(
      <div>
          < hr style={{width:"1px",height:"10px",borderTop:"1px solid red"}} className="col-md-2"/>
              <div className="col-xs-4 col-sm-4 col-md-4 col-lg-4">
               <div>
                  <div style={{float:"left"}}className="iconFB"><i className="fab fa-facebook-square"></i></div>
                  <button style={{marginLeft:"90px"}}type="button" className="btn btn-sm btn-default">Continue with Facebook</button>
                  
              </div >
              
              
              <div >
                <div style={{float:"left"}}className="iconGG"><i className="fab fa-google"></i></div>
                <button type="button" className="btn btn-primary" style={{marginLeft:"90px"}}>Continue with Google</button>
                
              </div>
              
              </div>
            
     </div>
   );
   }
   }
   export default Test;
